import React, { useState, Fragment } from "react";
import TileArea from "./components/TileArea";
import "./components/TileArea.css";

const dataObject = [
  { name: "Robert", job: "Walmart", hobby: "Finding rocks" },
  { name: "Tom", job: "Smith's", hobby: "Swimming" },
  { name: "Kyle", job: "Chevron", hobby: "Hanging with friends" },
  { name: "Ellie", job: "Joe's Crabshack", hobby: "Running" },
  { name: "Kelly", job: "Winco", hobby: "Gaming" },
  { name: "Rodney", job: "Sharp Foods", hobby: "Long Boarding" },
];

function App() {
  function clickHandler() {
    console.log("hey");
  }

  return (
    <div className="tile">
      <button className="button" onClick={clickHandler}>
        CLICK
      </button>

      <div className="tile">
        <TileArea
          name={dataObject[0].name}
          job={dataObject[0].job}
          hobby={dataObject[0].hobby}
        />
        <TileArea
          name={dataObject[1].name}
          job={dataObject.data[1].job}
          hobby={dataObject.data[1].hobby}
        />
        <TileArea
          name={dataObject.data[2].name}
          job={dataObject.data[2].job}
          hobby={dataObject.data[2].hobby}
        />
        <TileArea
          name={dataObject.data[3].name}
          job={dataObject.data[3].job}
          hobby={dataObject.data[3].hobby}
        />
        <TileArea
          name={dataObject.data[4].name}
          job={dataObject.data[4].job}
          hobby={dataObject.data[4].hobby}
        />
        <TileArea
          name={dataObject.data[5].name}
          job={dataObject.data[5].job}
          hobby={dataObject.data[5].hobby}
        />
      </div>
    </div>
  );
}

export default App;
